const HeatMap = ()  => {
    const d3HeatMap = useRef()

    useEffect(()=>{
        fetch("../data/StreamingHistoryDesi.json")
            .then(response => response.json())
            .then(data => {
                console.log(data);
            })
    })

    return (
        <div id='d3demo'>
            <svg ref={d3HeatMap}></svg>
        </div>
    )
}

export default HeatMap;
